import styled from "styled-components";

export const DiscountContainer = styled.div`
  height: 500px;
  background-color: #faedcd;
  margin-top: 75px;
  display: flex;
`;

export const DiscountText = styled.div`
  & > h1 {
    font-size: 42px;
  }

  & > p {
    color: #727272;
    max-width: 576px;
  }
`;

export const DiscountImg = styled.div``;
